public class InnerRuleGroupRuleGroupFactory(Action<Humidifier.NetworkFirewall.RuleGroupTypes.RuleGroup> factoryAction = null) : SubResourceFactory<Humidifier.NetworkFirewall.RuleGroupTypes.RuleGroup>
{

    internal InnerRuleGroupStatefulRuleOptionsFactory StatefulRuleOptionsFactory { get; set; }

    internal InnerRuleGroupReferenceSetsFactory ReferenceSetsFactory { get; set; }

    internal InnerRuleGroupRulesSourceFactory RulesSourceFactory { get; set; }

    internal InnerRuleGroupRuleVariablesFactory RuleVariablesFactory { get; set; }

    protected override Humidifier.NetworkFirewall.RuleGroupTypes.RuleGroup Create()
    {
        var ruleGroupResult = CreateRuleGroup();
        factoryAction?.Invoke(ruleGroupResult);

        return ruleGroupResult;
    }

    private Humidifier.NetworkFirewall.RuleGroupTypes.RuleGroup CreateRuleGroup()
    {
        var ruleGroupResult = new Humidifier.NetworkFirewall.RuleGroupTypes.RuleGroup();

        return ruleGroupResult;
    }
    public override void CreateChildren(Humidifier.NetworkFirewall.RuleGroupTypes.RuleGroup result)
    {
        base.CreateChildren(result);

        result.StatefulRuleOptions ??= StatefulRuleOptionsFactory?.Build();
        result.ReferenceSets ??= ReferenceSetsFactory?.Build();
        result.RulesSource ??= RulesSourceFactory?.Build();
        result.RuleVariables ??= RuleVariablesFactory?.Build();
    }

} // End Of Class

